--
-- Name: daily_ohlc; Type: VIEW; Schema: public; Owner: trading
--

CREATE VIEW public.daily_ohlc AS
 SELECT candles_1m.symbol,
    public.first(candles_1m.open, candles_1m."time") AS open,
    max(candles_1m.high) AS high,
    min(candles_1m.low) AS low,
    public.last(candles_1m.close, candles_1m."time") AS close,
    sum(candles_1m.volume) AS volume
   FROM public.candles_1m
  WHERE (candles_1m."time" >= CURRENT_DATE)
  GROUP BY candles_1m.symbol;


ALTER TABLE public.daily_ohlc OWNER TO trading;

